import React, { useEffect, useState } from 'react';
import { getParkingLogs } from '../services/apiService';

const ParkingLog = () => {
  const [logs, setLogs] = useState([]);

  useEffect(() => {
    const fetchLogs = async () => {
      const data = await getParkingLogs();
      setLogs(data);
    };
    fetchLogs();
  }, []);

  return (
    <div>
      <h2>Parking Logs</h2>
      <table>
        <thead>
          <tr>
            <th>License Plate</th>
            <th>Entry Time</th>
            <th>Exit Time</th>
            <th>Fee</th>
          </tr>
        </thead>
        <tbody>
          {logs.map((log) => (
            <tr key={log.licensePlate}>
              <td>{log.licensePlate}</td>
              <td>{log.entryTime}</td>
              <td>{log.exitTime || 'In Parking'}</td>
              <td>{log.fee ? `$${log.fee}` : '-'}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ParkingLog;
